import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";

export default function AdminDashboard() {
  const [products, setProducts] = useState([]);
  const [orders, setOrders] = useState([]);
  const [selectedProduct, setSelectedProduct] = useState(null);
  const [formData, setFormData] = useState({
    title: "",
    image: "",
    description: "",
    price: "",
    category: "",
    stock: "",
  });
  const [showEditModal, setShowEditModal] = useState(false);

  const navigate = useNavigate();

  useEffect(() => {
    fetchProducts();
    fetchOrders();
  }, []);

  const fetchProducts = async () => {
    const response = await fetch("http://localhost:7001/api/auth/product");
    const data = await response.json();
    setProducts(data);
  };

  const fetchOrders = async () => {
    const response = await fetch("http://localhost:7001/api/auth/orders");
    const data = await response.json();
    setOrders(data);
  };

  const handleEdit = (product) => {
    setSelectedProduct(product);
    setFormData(product);
    setShowEditModal(true);
  };

  const handleUpdate = async () => {
    const response = await fetch(
      `http://localhost:7001/api/auth/product/${selectedProduct._id}`,
      {
        method: "PUT",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(formData),
      }
    );
    if (response.ok) {
      fetchProducts();
      setShowEditModal(false);
    }
  };

  return (
    <div className="flex min-h-screen bg-gray-100">
      {/* Sidebar */}
      <aside className="w-1/4 bg-green-700 p-5 text-white">
        <h2 className="text-2xl font-bold">Admin Dashboard</h2>
        <nav className="mt-5">
          <button
            onClick={() => navigate("/admin/add-product")}
            className="block py-2"
          >
            Add Product
          </button>
          <button
            onClick={() => navigate("/admin/products")}
            className="block py-2"
          >
            All Products
          </button>
          <button
            onClick={() => navigate("/admin/orders")}
            className="block py-2"
          >
            Orders
          </button>
        </nav>
      </aside>

      {/* Main Content */}
      <main className="flex-1 p-6">
        <h2 className="text-xl font-bold">All Products</h2>
        <table className="w-full bg-white shadow-md rounded-lg mt-4">
          <thead>
            <tr className="bg-gray-200">
              <th className="p-2">Title</th>
              <th className="p-2">Category</th>
              <th className="p-2">Price</th>
              <th className="p-2">Stock</th>
              <th className="p-2">Actions</th>
            </tr>
          </thead>
          <tbody>
            {products.map((product) => (
              <tr key={product._id} className="border-t">
                <td className="p-2">{product.title}</td>
                <td className="p-2">{product.category}</td>
                <td className="p-2">${product.price}</td>
                <td className="p-2">{product.stock}</td>
                <td className="p-2">
                  <button
                    onClick={() => handleEdit(product)}
                    className="mr-2 text-blue-500"
                  >
                    Edit
                  </button>
                  <button className="text-red-500">Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Edit Modal */}
        {showEditModal && (
          <div className="fixed inset-0 flex items-center justify-center bg-black bg-opacity-50">
            <div className="bg-white p-6 rounded-lg w-96">
              <h2 className="text-xl font-bold mb-4">Edit Product</h2>
              <input
                type="text"
                value={formData.title}
                onChange={(e) =>
                  setFormData({ ...formData, title: e.target.value })
                }
                className="w-full mb-2 p-2 border"
                placeholder="Title"
              />
              <input
                type="text"
                value={formData.price}
                onChange={(e) =>
                  setFormData({ ...formData, price: e.target.value })
                }
                className="w-full mb-2 p-2 border"
                placeholder="Price"
              />
              <button
                onClick={handleUpdate}
                className="bg-green-500 text-white px-4 py-2"
              >
                Update
              </button>
              <button onClick={() => setShowEditModal(false)} className="ml-2">
                Cancel
              </button>
            </div>
          </div>
        )}
      </main>
    </div>
  );
}
